async function taiveFile(fn) {
  try {
    let blob = window.blob1.filter(m => m.fn == fn)[0];
    if (!window.$tfl || !blob) {
      return
    }
    let b1 = blob.blob;
    let o = new Uint8Array(b1);
    //await $tfl.fs.writeBinaryFile('path file', new Uint8Array([]));
    let pn = await $tfl.path.downloadDir() + "/" + fn;
    pn = pn.split("//").join("/");
    alert("File is downloaded to: " + pn);
    await $tfl.fs.writeBinaryFile(pn, o);
  } catch (err) {
    alert(err)
  }
}
