function downloadBlob(blob, name = 'file.txt') {
  if (
    window.navigator && 
    window.navigator.msSaveOrOpenBlob
  ) return window.navigator.msSaveOrOpenBlob(blob);

  // For other browsers:
  // Create a link pointing to the ObjectURL containing the blob.
  var data = window.URL.createObjectURL(blob);

  const link = document.createElement('a');
  link.href = data;
  link.download = name;

  // this is necessary as link.click() does not work on the latest firefox
  link.dispatchEvent(
    new MouseEvent('click', {bubbles: true,cancelable: true,view: window})
  );

  setTimeout(() => {
    // For Firefox it is necessary to delay revoking the ObjectURL
    window.URL.revokeObjectURL(data);
    link.remove();
  }, 100);
}

function file2base64(file){
  return new Promise(r3=>{
    let reader = new FileReader();
    reader.readAsDataURL(file);
    reader.onload = function () {
      r3(reader.result);
    };
    reader.onerror = function (error) {r3(``);};
  });
}

async function file2blob(file){
  return new Blob([new Uint8Array(await file.arrayBuffer())], {type: file.type });
}
function sendFilePeer(d,peerTo,peerToId,user){
  d.id=peerToId;
  d.user=user;
  let conn = peer.connect(peerTo);
  conn.on('open', function() {
    // Receive messages
    conn.on('data', function(data) {console.log('Received', data);});
    // Send messages
    conn.send(d);
    console.log(d);

    var file = new File([d.blob], d.name);
    var url=URL.createObjectURL(file);
    //console.log(url);
    //soc.send(sendto_T_,"File transfer",d.id,url);

    let tid=Date.now().toString(36)+(Math.floor(Math.random() * Date.now())).toString(36).padStart(8,"0");
    let time=Date.now();
    let ob={time:time, userId: user, data: {type:"data",data:{id:tid,content:"File transfer",user:user}}};
    ob.data.data.fileUrl=url;
    ob.data.data.fileName=d.name;
    appendD(ob);

  });
}
